import React from 'react';
import { AppBar, Toolbar, ListItem,
  IconButton,
  ListItemText,
  Avatar,
  Divider,
  List,
  Typography,
  Box
} from "@material-ui/core";
import { 
  ArrowBack,
  AssignmentInd,
  Home,
  Apps,
  ContactMail
} from "@material-ui/icons";
import avatar from "../avatar.png"


const Navbar = () => {
  return (
    <>
      <Box component="div">
        <Avatar src={avatar} alt="Akhila"/>
      </Box>

    </>
  )
}

export default Navbar;
